measurements.description:
Eight flowers and 26 buds on 34 wiry inflorescences, 16cm in length, borne on a robust floriferous plant, 48-cm in diameter,
    grown in moss in a 17-cm basket; leaves lanceolate, mostly trimmed apically, 20.0-cm in length, 2.1-cm in width;
    sepals white, stippled burgundy on front and reverse, darker and smaller proximally, dense light yellow hirsute, caudae dark mahogany;
    petals white; lip light pink; column white; anther cap yellow; substance firm; texture matte.
